import React from "react";

const About = () => {
  return (
    <div>
      <h2>About Me</h2>
      <p>Hi, I'm a passionate Software Developer skilled in Java, React, Spring Boot, and Full-Stack Development.</p>
      <p>I enjoy building modern web applications, optimizing performance, and designing scalable systems.</p>
      <p>Currently, I'm working on my e-commerce project using React and exploring cloud kitchen solutions.</p>
    </div>
  );
};

export default About;
